import React, { Component } from 'react'

export default class Test7Sub extends Component {
    render() {
        //비구조할당
        const {
            name, age,addr,done,color,tel,title
        } = this.props
        return (
            <div>
                <h2>Test7Sub :{title}</h2>
                <ul>
                    <li>이름 : {name}</li>
                    <li>나이 : {age}</li>
                    <li>주소 : {addr}</li>
                    <li>전화 : tel</li>
                    <li>참여 : </li>
                </ul>
            </div>
        )
    }
}
